def SendTxn(txn):
    signed_txn = platon.account.signTransaction(txn,private_key=send_privatekey,net_type=TESTNETHRP,mode='SM')
    res = platon.sendRawTransaction(signed_txn.rawTransaction).hex()
    txn_receipt = platon.waitForTransactionReceipt(res)
    print(res)
    return txn_receipt
